  false,\n\t\"url\": null,\n\t\"notes\": \"The entire coastline of Big Koniuji, Atkins,
  Herendeen, Peninsula and Hall Islands, Murre Rocks, and Castle Rock were surveyed.
  Also surveyed was the coast line of Little Koniuji from the north end of Sandy Cove
  on the east to Northwest Harbor on the west. Distribution of terrestrial mammals
  was noted. The feeding habits of the River Otter and Red Fox are discussed. Marine
  mammals, such as otters and seals were censused. Effort was made to determine the
  use of this area by cetaceans.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
